import './App.css';
import GroupStage from './components/GroupStage';
import Quarterfinals from './components/Quarterfinals';
import Round16 from './components/Round16';
import Semifinals from './components/Semifinals';

function App() {
  return (
    <div className="App">
      <GroupStage />
      <Round16 />
      <Quarterfinals />
      <Semifinals />
    </div>
  );
}

export default App;
